import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../App.css';
import info3 from '../../images/info_3.png';

function Delete() {
  return (
    <div className="App bg-green">
        <h2>ADVERTENCIA</h2>
      <header className="App-header">
        <p className=''>Â¿Seguro que quiere eliminar este registro?</p>
        <img src={info3} alt="Imagen 1" className="img-fluid mx-5 image-width" />
        <div className='row'>
            <div className='col-md-5'>
            <button type="submit" className="btn btn-success mx-3 fs-3">Confirmar</button>
            </div>
            <div className='col-md-5'>
            <button type="submit" className="btn btn-success mx-3 fs-3">Cancelar</button>
            </div>
        </div>
      </header>
    </div>
  );
}

export default Delete;
